inline void ReadMLP_Garlic_en05_1_trkPibck::Transform_1( std::vector<double>& iv, int cls) const
{
   if (cls < 0 || cls > 2) {
       if (2 > 1 ) cls = 2;
       else cls = 2;
   }
   bool FlatNotGaussD = false;
   double cumulant;
   const int nvar = 9;
   for (int ivar=0; ivar<nvar; ivar++) {
   int ibin1 = (int) ((iv[ivar]-xmin[ivar][cls])/(xmax[ivar][cls]-xmin[ivar][cls])*1000);
   if (ibin1<=0) { cumulant = cumulativeDist[ivar][cls][0];}
   else if (ibin1>=1000) { cumulant = cumulativeDist[ivar][cls][1000];}
   else {
           int ibin2 = ibin1+1;
           double dx = iv[ivar]-(xmin[ivar][cls]+0.001           * ibin1* (xmax[ivar][cls]-xmin[ivar][cls]));
           double eps=dx/(xmax[ivar][cls]-xmin[ivar][cls])*1000;
           cumulant = eps*cumulativeDist[ivar][cls][ibin1] + (1-eps)*cumulativeDist[ivar][cls][ibin2];
           if (cumulant>1.-10e-10) cumulant = 1.-10e-10;
           if (cumulant<10e-10)    cumulant = 10e-10;
           if (FlatNotGaussD) iv[ivar] = cumulant;
           else {
              double maxErfInvArgRange = 0.99999999;
              double arg = 2.0*cumulant - 1.0;
              if (arg >  maxErfInvArgRange) arg= maxErfInvArgRange;
              if (arg < -maxErfInvArgRange) arg=-maxErfInvArgRange;
              double inverf=0., stp=1. ;
              while (stp >1.e-10){;
                if (erf(inverf)>arg) inverf -=stp ;
                else if (erf(inverf)<=arg && erf(inverf+stp)>=arg) stp=stp/5. ;
                else inverf += stp;
              } ;
              //iv[ivar] = 1.414213562*TMath::ErfInverse(arg);
              iv[ivar] = 1.414213562* inverf;
           }
       }
   }
}

